import { StyleSheet } from "react-native";

const styles=StyleSheet.create({
    eyeContainer:{
        width:'100%',
        height:'100%',
    
      },
    
      titles: {
        marginTop: '30%',
        width:'100%',
        alignItems: 'center',
      },
    
      title: {
        fontSize: 35,
        fontWeight:'500',
      },
    
      subtitles: {
        fontSize:16,
        color: 'grey',
    
      },
    
      image: {
        width:'100%',
        height:'100%',
        resizeMode: 'cover',
        position: 'absolute',
      },

      buttonsContainer:{
        position: 'absolute',
        bottom: 50,
        width:'100%',
      },

      buttMicrophone:{
        position: 'absolute',
        bottom: 210,
        width:'100%',
        backgroundColor:'white',
      },

      

});

export default styles;
